                          } else {}
                        }
                        print("prechecks ${ref.read(prechecksProcedure)}");
                        print("bprechecks ${ref.read(bprechecksProcedure)}");
                        print(
                            "systemchecks ${ref.read(systemchecksProcedure)}");
                        print("shutdown ${ref.read(shutdownProcedure)}");

                        setState(() {
                          player.stop();
                          stopFunction = true;
                        });

                        Navigator.push(
                            context,
                            MaterialPageRoute(
                                builder: (context) => const Home()));
                      },
                      child: const Text(
                        "Back to Menu",
                        textAlign: TextAlign.center,
                      )),
                ),
              ),
              FloatingActionButton(
                  onPressed: () {
                    setState(() {
                      isPaused = !isPaused;
                      print("isPaused $isPaused");
                    });
                    _togglePause();
                  },
                  child: isPaused == false
                      ? const Icon(Icons.pause)
                      : const Icon(Icons.play_arrow)),
            ],
          ),
        ],
      ),
    );
  }
}
